    let rec checkCorrectOrder (left: Packet) (right: Packet) : int =
        match (left, right) with
        | (Digit l, Digit r) ->
            if l < r then 1
            elif l = r then 0
            else -1
        | (SubPacket ls, SubPacket rs) ->
            match (ls, rs) with
            | ((l :: lss), (r :: rss)) ->
                let res = checkCorrectOrder l r

                if res = 0 then
                    checkCorrectOrder (SubPacket lss) (SubPacket rss)
                else
                    res
            | ([], (r :: rss)) -> 1
            | ((l :: lss), []) -> -1
            | ([], []) -> 0
        | (Digit _, SubPacket _) -> checkCorrectOrder (SubPacket [ left ]) right
        | (SubPacket _, Digit _) -> checkCorrectOrder left (SubPacket [ right ])

    let part1 (input: string) : string =
        realInput1
        |> List.toArray
        |> Array.mapi (fun i (l, r) ->
            i, (checkCorrectOrder l r))
        |> Array.filter (fun (_, v) -> v = 1)
        |> Array.map fst
        |> Array.map ((+) 1)
        |> Array.sum
        |> string

    let part2 (input: string) : string =
        let dividerPackets = [(SubPacket [SubPacket [Digit 2]]);(SubPacket [SubPacket [Digit 6]])]

        (realInput2 @ dividerPackets)
        |> List.sortWith (fun a b -> -(checkCorrectOrder a b))
        |> List.mapi (fun i c -> (i,c))
        |> List.filter (fun (i,c) -> List.contains c dividerPackets)
        |> List.map fst
        |> List.map ((+) 1)
        |> List.fold (fun state i -> state * i) 1
        |> string
